import Main from "../components/main";
import Navbar from "../components/navbar";
import { Container } from "./App.styled";
import "../index.css"
import { Provider } from "react-redux";

function App() {
  return (
      <Provider>
    <Container>
      <Navbar />
      <Main />
    </Container>
      </Provider>
  );
}

export default App;
